import React from 'react'
import {Menu,MenuItem,Button} from '@material-ui/core'

const MenuOfItems = (props) => {
    handleActionClose = (id, event) => {
        let { anchorEls } = this.state;
        anchorEls[id] = null;
        this.setState({ anchorEls });
    }
    return (
        <div>                                            
            <MenuItem onClick={e => this.handleActionClose(props.id, e)}>VER PERFIL</MenuItem>
            <MenuItem onClick={e => this.handleActionClose(props.id, e)}>VER SINTOMAS</MenuItem>
            <MenuItem onClick={e => this.handleActionClose(props.id, e)}>VER REGISTRO DIARIO</MenuItem>
            <MenuItem className="menu-item-eliminar" onClick={e => this.handleActionClose(props.id, e)}>ELIMINAR</MenuItem>
        </div>
    )
}

export default MenuOfItems
